void matchesInRequestBodyOnLiteralZonedDate(){
    stubFor(
        post("/date")
            .withRequestBody(matchingJsonPath("$.date", before("2021-10-11T00:00:00Z")))
            .willReturn(ok()));

    assertThat(
        testClient
            .postJson("/date", "{\n" + "  \"date\": \"2021-06-22T23:59:59Z\"\n" + "}")
            .statusCode(),
        is(200));

    assertThat(
        testClient
            .postJson("/date", "{\n" + "  \"date\": \"2121-06-22T23:59:59Z\"\n" + "}")
            .statusCode(),
        is(404));
  }
